import './Sidemenu.css';

function Sidemenu(){
    return(
        <ul className="list">
            <li onClick={props.clickHandler.bind(this, <About /> )}>About me</li>
            <li>Technologies and Curriculum</li>
            <li>Projects</li>
            <li>Contact</li>
        </ul>
    )
}

export default Sidemenu;
